import React from "react";
import './Navbar.css'
import { Link } from "react-router-dom";

const Navbar = () => {


  return (
    <div>
      <nav>

        <h3>Wild Circus. </h3>
        <ul className="nav-links my-auto">
        <Link  to="/">
            <li className='liLinks'>Home</li>
          </Link>

          <Link to="/history">
            <li className='liLinks'>History</li>
          </Link>

          <Link to='/contact'>
            <li className='liLinks'>Contact</li>
          </Link>

          <Link to='/shop'>
            <li className='liLinks'>Shop</li>
          </Link>
        </ul>
      </nav>
    </div>
  );
};

export default Navbar;
